snippet.description:
During my journey towards catching every Shiny Pokemon in the Pokemon franchise, I've taken on a few generations containing some of the most difficult hunts in the games. Despite that, there were much more difficult gens on the horizon. After completing the Shiny Pokedex for Generation 4, I decided to take on the following generation: home to the largest Pokedex in the history of the franchise. And this is how it went. This video took a lot of time and effort to put together, so I'd really appreciate it if you shared this with a friend. If you have any suggestions for the next video, leave it in the comments below! Have a great day :)
